import React from "react";
import Movie from "./movie";

const Movies = ({ movies, onDelete }) => {
  return (
    <table className="table">
      <thead>
        <tr>
          <th scope="col">Title</th>
          <th scope="col">Genre</th>
          <th scope="col">Stock</th>
          <th scope="col">Rate</th>
          <th scope="col" />
          <th scope="col" />
        </tr>
      </thead>
      <tbody>
        {movies.map(movie => (
          <Movie
            onDelete={onDelete}
            onLiked={onLiked}
            key={movie._id}
            movie={movie}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Movies;
